// Get select elements
const regionSelect = document.getElementById("regionSelect");
const districtSelect = document.getElementById("districtSelect");
const wardSelect = document.getElementById("wardSelect");
const villageSelect = document.getElementById("villageSelect");

// Populate regions dropdown
const regions = [...new Set(data.map(item => item.region))];
regions.forEach(region => {
  const option = document.createElement("option");
  option.value = region;
  option.textContent = region;
  regionSelect.appendChild(option);
});

// Event listener for region selection
regionSelect.addEventListener("change", function() {
  // Clear district, ward, and village dropdowns
  districtSelect.innerHTML = "<option value=''>Select District</option>";
  wardSelect.innerHTML = "<option value=''>Select Ward</option>";
  villageSelect.innerHTML = "<option value=''>Select Village</option>";

  const selectedRegion = this.value;
  
  // Filter districts based on selected region
  const districts = [...new Set(data.filter(item => item.region === selectedRegion).map(item => item.district))];
  districts.forEach(district => {
    const option = document.createElement("option");
    option.value = district;
    option.textContent = district;
    districtSelect.appendChild(option);
  });
});

// Event listener for district selection
districtSelect.addEventListener("change", function() {
  // Clear ward and village dropdowns
  wardSelect.innerHTML = "<option value=''>Select Ward</option>";
  villageSelect.innerHTML = "<option value=''>Select Village</option>";

  const selectedDistrict = this.value;

  // Filter wards based on selected district
  const wards = [...new Set(data.filter(item => item.district === selectedDistrict).map(item => item.ward))];
  wards.forEach(ward => {
    const option = document.createElement("option");
    option.value = ward;
    option.textContent = ward;
    wardSelect.appendChild(option);
  });
});

// Event listener for ward selection
wardSelect.addEventListener("change", function() {
  // Clear village dropdown
  villageSelect.innerHTML = "<option value=''>Select Village</option>";

  const selectedWard = this.value;

  // Filter villages based on selected ward
  const villages = data.filter(item => item.ward === selectedWard);
  villages.forEach(village => {
    const option = document.createElement("option");
    option.value = village.village;
    option.textContent = village.village;
    villageSelect.appendChild(option);
  });
});


